import React from 'react';
import data from "../response.json"

export default (props) => {

    let { data } = props
    return (
        <div>
            {
                data && <div>
                    <ul>
                        {
                            data.children.map((item, index) => {
                                return (
                                    <li key={index}> {item.name} ({item.path})</li>
                                )
                            })
                        }
                    </ul>
                    <div class="heart"></div>
                </div>
            }

            <style jsx>{`

.heart {
    background-color: red;
    height: 300px;
    width: 300px;
    position: absolute;
    transform: rotate(135deg);
    margin: 100px;
  }
  
  .heart::before {
    content:"";
    background-color: red;
    height: 300px;
    width: 300px;
    border-radius: 50%;
    position: absolute;
    top: 0px;
    right: 140px;
  }
  
  .heart::after {
    content:"";
    background-color: red;
    height: 300px;
    width: 300px;
    border-radius: 50%;
    position: absolute;
    top: 140px;
    right: 0px;
  }

        ul{
          padding: 0px;
        }
        li{
          list-style-type: none;
          margin-bottom: 20px;
          margin:30px;
        }
        a{
          text-decoration: none;
          color: black;
        }
        
      `}</style>
        </div>
    )
}
